import React from 'react';
import logo from './logo.svg';
import './App.css';

import Login from './Components/User/HomeLogin/Login'
export default class App extends React.Component {
    componentDidMount() {
        fetch('/timeline')
            .then(res => res.text())
            .then(res => res)
    }
    render() {
        return (
            <div className="App">
                <Login />

            </div>
        );
    }
}
